from Roslina import Roslinaclass WilczeJagody(Roslina):	def __init__(self, x, y, swiat):		super().__init__()		self.sila = 99		self.polozenie_x = x		self.polozenie_y = y		self.swiat = swiat		self.kolor = (25, 25, 112)	def kolizja(self, atakujacy, obronca):		obronca.swiat.usunZKolejki(atakujacy.getPolozenieX(), atakujacy.getPolozenieY())		obronca.swiat.organizmy[atakujacy.getPolozenieX()][atakujacy.getPolozenieY()] = None